/*
from PIL import Image, ImageFont, ImageDraw

def generate(c):
    bmp = Image.new("RGB", (48,48), (0,0,0,0))
    draw  = ImageDraw.Draw(bmp)
    font = ImageFont.truetype("DroidSansMono.ttf", 62)
    draw.text((4,-18), c, font=font, fill="#ffffff")
    return bmp

digitals = u"0123456789."
f = open('font.h', 'a+')
for c in digitals:
    bmp = generate(c)
    (width,height) = bmp.size
    f.write('{\n')
    for y in range(0, height):
        for x in range(0, width):
            (r, g, b) = bmp.getpixel((x,y))
            f.write("{0:#8x}, ".format(r<<16|g<<8|b))
        f.write("\n")
    f.write('},\n')
*/

